import javax.servlet.http.HttpSession;

HttpSession session = servletRequest.getSession(false);
if (session != null) {
    Object user = session.getAttribute("user");
    if (user != null) {
        return "User \"" + user.toString() + "\"";
    } else {
        return "Unauthenticated";
    }
} else {
    return null; // Do not split
}
